import React, { useState, useEffect } from 'react';
import TradingPanel from '../components/TradingPanel';
import { authAPI } from '../services/api';

const Trading = ({ user, setUser }) => {
  const handleUpdate = (wallets) => {
    if (wallets) {
      setUser({ ...user, wallets });
    }
  };

  return (
    <div style={{ padding: '20px', background: 'transparent', minHeight: 'calc(100vh - 70px)' }}>
      <div className="container">
        <div className="card" style={{ background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)', color: 'white', marginBottom: '30px' }}>
          <h1 style={{ fontSize: '32px', marginBottom: '10px' }}>ðŸ“ˆ Trading</h1>
          <p style={{ opacity: 0.9, fontSize: '16px' }}>Buy and sell USDT at competitive rates</p>
        </div>
        {user && <TradingPanel user={user} onUpdate={handleUpdate} />}
      </div>
    </div>
  );
};

export default Trading;
